    /**
    * Función donde se implementa el DataFixture
    * @param ObjectManager $manager Manejador de Doctrine
    * @return void
    */
    public function load(ObjectManager $manager)
    {   
        //Se inicializan las variables para procesar el datafixtures
        $parent = null;
        $root = null;
        $level = 0;
        $locations = $this->locations;
        $cities = array();
        $cities_parishes = array();
        
        $this->persistLocation($manager,$locations,$parent, $root, $level, $cities, $cities_parishes);
        $this->persistCities($manager, $cities, $cities_parishes);

        $manager->flush();
    }

    /**
    * La siguiente es recursiva donde se realiza la persistencia de manera recursiva y en forma de arbol
    * @author Freddy Contreras <freddycontreras3@gmail.com>
    * 
    * @param EntityManager $manager
    * @param array $locations
    * @param Object Location $parent
    * @param Object Location $root
    * @param integer $level
    * @param array $cities
    * @param array &$cities_parishes
    * @return void
    * @version 29/07/2015
    */
    private function persistLocation(&$manager, $locations, $parent, $root, $level, &$cities, &$cities_parishes)
    {
        foreach($locations as $currentLocation)
        {
            $location = new Location();
            $location->setTitle($currentLocation['name']);
            $location->setLvl($level);
            $location->setRoot($root);
            
            // Son paises si el nivel es cero
            if ($level == 0) {
                $location->setNumber($currentLocation['code']);
                $location->setAlfa2($currentLocation['alfa2']);
                $location->setAlfa3($currentLocation['alfa3']);
            }

            if (!is_null($parent))
                $location->setParent($parent);

            //Si el nivel es 4, se almacena como una ciudad
            if ($level == 4) {
                $auxArray['name'] = $currentLocation['name'];
                $auxArray['entity'] = $location;
                array_push($cities,$auxArray);
            
            //Si el nivel es 3, se almacena como una parroquia perteneciente a una ciudad 
            // o una parroquia comun de un estado
            } else if ($level == 3) {
                //Si pertenece a una ciudad
                if (isset($currentLocation['city_parent'])) {
                    $auxArray['name_parent'] = $currentLocation['city_parent'];
                    $auxArray['entity'] = $location;
                    array_push($cities_parishes,$auxArray);
                } else {
                    $manager->persist($location);
                }
            } else {
                $manager->persist($location);    
            }

            if (is_null($root))
                $currentRoot = $location;
            else            
                $currentRoot = $root;

            //Si pertenece a una ciudad
            if (isset($currentLocation['city']) and !empty($currentLocation['city']))
                $this->persistLocation($manager,$currentLocation['city'],$location, $currentRoot, 4, $cities, $cities_parishes);

            if (isset($currentLocation['subLocations']) and !empty($currentLocation['subLocations']))  
                $this->persistLocation($manager,$currentLocation['subLocations'],$location, $currentRoot, $level+1, $cities, $cities_parishes);                                     
        }
    }

    /**
    * La siguiente función procesa la persistencia de las ciudades 
    *
    * @author Freddy Contreras <freddycontreras3@gmail.com>
    * @param EntityManager $manager
    * @param array $cities
    * @param array $cities_parishes
    * @return void
    * @version 29/07/2015
    */
    private function persistCities(&$manager, $cities, $cities_parishes)
    {
        foreach ($cities as $currentCity) {
            foreach ($cities_parishes as $key => $currentLocation) {
                if ($currentCity['name'] == $currentLocation['name_parent']) {                    
                    $currentLocation['entity']->setCityId($currentCity['entity']);
                    $manager->persist($currentLocation['entity']);
                    array_splice($currentLocation, $key, 1);
                }
            }
            $manager->persist($currentCity['entity']);
        }
    }
    
